import React, {Component} from 'react';
import {Helmet} from 'react-helmet';
import ProjectCard from '../components/projectCard';


const title = "Projects|Alper Tunca";
/*
 Card ların yer aldıgı div düzenlenecek
 */

const robotArmText = "The robot arm we developed in an undergraduate lesson, the application I developed to manage with an android-based device. Go inside for details.";
const cansatText = "For the CanSat competition organized annually by NASA, " +
    "the embedded software of the electronic circuit board belonging to the scientific load of the model satellite is here. Go inside for details.";


class Projects extends Component {

    openInNewTab(url) {
        const win = window.open(url, '_blank');
        win.focus();
    }

    render() {

        const colorStyle = {
            color: "#34A4EB"
        };


        return (
            <div className="mt-3">
                <Helmet>
                    <title>{title}</title>
                </Helmet>
                <h1 style={colorStyle}>PROJECTS</h1>
                <p style={{color: "#FFFFFF"}}>Some projects are here, You can o pen <a target="_blank" rel="noopener noreferrer" href="https://github.com/alperTunca?tab=repositories" style={{color: "#34A4EB"}}>github</a> for more</p>

                <div className="ml-4 mr-4 mt-2" style={{textAlign : ""}}>
                    <ProjectCard border="success" cardHeader="Robot Arm"
                                 imgURL="../robot-arm.png" info={robotArmText}
                                 link="https://github.com/alperTunca/Robot-Arm"/>
                    <br/>
                    <ProjectCard border="warning" cardHeader="Payload Circuit Code - Cansat 2019"
                                 imgURL="./cansat-circuit.jpg" info={cansatText}
                                 link="https://github.com/alperTunca/cansat-payload-embeded"/>
                </div>

            </div>
        );
    }
}

export default Projects;
